import React from 'react'
import Reactdom from 'react-dom'
function add(a, b) {
  return (a + b);
}
function mul(a, b) {
  return a * b;
}
function sub(a, b) {
  return a - b;
}
function div(a, b) {
  return a / b;
}
Reactdom.render(
  <>
    <ol>
      <li>
        Addition of two numbers are {add(3, 4)}
      </li>
      <li>
        Subtraction of two numbers are {sub(3, 4)}
      </li>
      <li>
        Multiplication of two numbers are {mul(3, 4)}
      </li>
      <li>
        Division of two numbers are {div(10, 3)}
      </li>
    </ol>
  </>, document.getElementById('root')
)
